(3, 'Maurys  Regionaal PrimeCaree Clinics-Suites 401', 1, 0, 14, 0, '', 0, '854 W. James Campbell Blvd,Suite 403 Columbia, TN 34820', '<p>Maury Regional PrimeCare Clinic in Suite 403 of the Maury Regional Medical Plaza in Columbia, TN is a full-service practice that specializes in the care of children and adults. .</p>\r\n', 'Maury Regional PrimeCare Clinic in Suite 403 of the Maury Regional Medical Plaza in Columbia, TN is a full-service practice that specializes in the...', '10:00 AM', '02:00 PM', '931-380-5550', 'www.mauryregional.com', 'bbead8d9bd47e0f975d5d32260e8dhdyd55585.jpg', 'Yes', 'Active', '2020-06-29 18:09:43', '2020-06-29 18:09:43'),
(4, 'The Gateway Restaurant & Lodge', 3, 0, 15, 0, '', 0, '45978 Sierra Drive Three Rivers, CA 93271', '<p>The Gateway Restaurant and Lodge, nestled in the foothills of the Sierra Mountains on the Kaweah River and just minutes away from Sequoia National Park, Kings Canyon, and other popular destinations, is the perfect hideaway for a relaxing, memorable vacation.<br />\r\n<br />\r\nThe Gateway Restaurant and Lodge is one of California&#39;s best lodging options for your visit to Sequoia National Park, the Sierra Mountains, Kings Canyon, and other Kaweah River locales. And, with full-service banquet facilities and a large meeting room, The Gateway is ideal for small groups, sales meetings, and retreats.<br />\r\n<br />\r\nOur beautiful setting overlooking the Kaweah River combined with our hospitality, our fine cuisine, and comfortable lodging will make your vacation unforgettable. We&#39;d love to be your guide to a memorable experience in Three Rivers and the beautiful Sierra Mountains!</p>\r\n', 'The Gateway Restaurant and Lodge, nestled in the foothills of the Sierra Mountains on the Kaweah River and just minutes away from Sequoia National ...', '10:00 AM', '11:00 PM', '22222222', 'www.gateway-sequoia.com', 'bbead8d9bd47e0f975d5d32260e8d30c.png', 'Yes', 'Active', '2020-06-29 19:38:31', '2020-06-29 19:38:31'),
(5, 'Heritage Plumbing Heating Cooling Electric', 2, 0, 23, 0, '', 0, '28 Commercial Ct, Auburn, NH 03032', '<p>We are Your Local Plumbers, Heating and AC Technicians, and Electricians. Get prompt and professional plumbing, heating, air conditioning, and electrical services. Our quality staff of licensed and local plumbers and electricians have been providing local plumbing, heating, air conditioning, and electric services in the New Hampshire area since our beginnings in 1986. At our heart, Heritage is a family company with a longstanding reputation for providing quality service for a fair price. People tell us that they see our service trucks everywhere in the area, which is true since there&#39;s a good chance that one of our technicians is also your neighbor. This makes it easy for us to be at your home promptly to help you solve your household plumbing, heating, AC, and electrical problems. It also makes it easy for us to do all that we can to maintain our reputation for quality service. One way we continue to improve the quality of our work is through regular training and certification for our great attendants who are behind the scenes making the magic happen. So whether you are struggling with a clogged drain or a noisy furnace, or you need an installation of an appliance, you will see the results of our devotion in the service you receive. If you are experiencing a problem with your plumbing, heating, AC, or electricity at home, then you should give us a call and see what we mean by quality service that is guaranteed. From clogged drains to AC installation to electricians work, we offer a variety of quality services and products at fair prices to NH residents and northern MA residents guaranteed!</p>\r\n', 'Plumbers, Air Conditioning Repair, Heating & Air Conditioning Contractors', '7:00AM', '12:00PM', '603-668-4438', 'www.justcallheritage.com', '', 'Yes', 'Active', '2020-07-06 14:48:15', '2020-07-06 14:48:15'),
(6, 'Gold Medal Service', 2, 0, 24, 0, '', 0, '11 Cotters Ln, East Brunswick, NJ 08816', '', '', 'Open 24 Hours', 'Open 24 Hours', '732-387-3842', 'www.goldmedalservice.com', '47cde6a3a83fd83f4e2d0ad6ddca8001.jpg', 'Yes', 'Active', '2020-07-06 14:57:11', '2020-07-06 14:57:11'),
(7, 'The Comus Inn At Sugarloaf Mountain', 3, 0, 25, 0, '', 0, '23900 Old Hundred Rd, Dickerson, MD 20842', '<p>The Comus Inn is the perfect choice for a relaxing afternoon or evening out with family or friends. The restaurant is a rehabilitated historical property with a stunning view of Sugarloaf Mountain. The Comus Inn utilizes the freshest ingredients from local produce and cheeses, hormone free beef and sustainable seafood to provide a dining experience to suit your taste and appetite. Food is prepared to order with artful presentations that appeal to both the palate and the eye. Our goal is to provide our customers with a superior dining experience from the moment they enter until their departure. We promise to greet you quickly, sincerely and elegantly, serve you with highly trained staff and most of all serve dishes that are high quality, cutting edge and the best value.</p>\r\n', 'hgigihi', '5pm,2pm,4,5,5,5,5', '8pm,7pm,5,5,5,5,5', '301-349-5100', 'www.mauryregional.com', '', 'Yes', 'Active', '2020-07-06 15:10:22', '2020-07-06 15:10:22'),
(8, 'Johnny\'s Dock Restaurant & Marina', 3, 0, 26, 0, '', 0, '1900 E D St, Tacoma, WA 98421', '<p>Johnny&#39;s Dock Restaurant is located in the heart of downtown Tacoma, WA, on the Thea Foss Waterway across from the Museum of Glass and near the city center&#39;s hotels, theater district, Tacoma Dome and other nearby attractions. Serving delicious and delightful food for over 50 years, we feature the finest of steaks and seafood in a warm and inviting environment.<br />\r\nGuests can enjoy our comfortable deck seating during the summer. Our indoor seating also offers beautiful views of the waterway and marina.</p>\r\n', '', '11:00 AM', '09:00 PM', '', 'www.johnnysdock.com', '6d89b30e2fd17329c4633879cd753381.jpeg', 'Yes', 'Active', '2020-07-06 15:14:29', '2020-07-06 15:14:29'),
