(18, 'Swiss Louis Italian & Seafood Restaurant', 31, 0, 15, 0, '', 0, '39 Pier, Ste G2, San Francisco, CA 94133', '<p>There is no destination like Swiss Louis Italian &amp; Seafood Restaurant, located at Pier 39. A tradition in San Francisco since 1936, our waterfront dining rooms, provides a magnificent view of the Golden Gate Bridge, Alcatraz and the always entertaining Sea Lions. We offer a casual dining experience that includes delicious Traditional Italian fare and fresh seafood at reasonable prices. Our service is accommodating and friendly. Open 7 days a week for lunch and dinner. Swiss Louis Restaurant also offers great options for group dining and entertaining.</p>\r\n', 'There is no destination like Swiss Louis Italian & Seafood Restaurant, located at Pier 39. A tradition in San Francisco since 1936, our waterfront dining rooms, provides a magnificent view of the Golden Gate Bridge, Alcatraz and the always entertaining Sea Lions. We offer a casual dining experience that includes delicious Traditional Italian fare and fresh seafood at reasonable prices. Our service is accommodating and friendly. Open 7 days a week for lunch and dinner. Swiss Louis Restaurant also offers great options for group dining and entertaining.', '11:00AM', '9:00PM', '415-421-2913', 'http://www.swisslouis.com/', '6906a06bcd788d576bb28bc21abb9a19.jpg', 'Yes', 'Active', '2020-07-06 17:12:05', '2020-07-06 17:12:05'),
(19, 'D\'amore\'s Pizza', 31, 0, 16, 0, '', 0, '8369 W 3rd St, Ste D, Los Angeles, CA 90048', '<p>Being 100% Italian, I grew up with the kind of food many people typically associate us with: Authentic, fresh and simply delicious. My grandmother was one of the many women who helped bring our great reputation for food to life. She made such wonderful meals that I&#39;ve since found myself on an often times frustrating and disappoining quest for those same flavors and qualties I&#39;d come to expect. When my grandmother started getting on in years I decided that I had to get her to teach me some of her recipes. To let such treasures slip into oblivion would be a culinary crime as far as I was concerned. So, having re-located to sunny California from the North End of Boston years ago, I sent for my &quot;Mommanonna&quot; as we called her. Her pizza was already very famous in the North End and as finding a good slice anywhere west of the Mississippi is an arduous feat, I knew that it would be a most valued commodity. So, to commemorate the event I invited my friends and family to taste her masterpiece. It was served and then with great enthusiasm we took our first bite. But, alas, something was wrong. It didn&#39;t taste the same. &quot;It&#39;s the crust!&quot; we unanimously declared as we watched it sag shamefully before us.</p>\r\n', 'Being 100% Italian, I grew up with the kind of food many people typically associate us with: Authentic, fresh and simply delicious. My grandmother was one of the many women who helped bring our great reputation for food to life. She made such wonderful meals that I\'ve since found myself on an often times frustrating and disappoining quest for those same flavors and qualties I\'d come to expect. When my grandmother started getting on in years I decided that I had to get her to teach me some of her recipes. To let such treasures slip into oblivion would be a culinary crime as far as I was concerned. So, having re-located to sunny California from the North End of Boston years ago, I sent for my \"Mommanonna\" as we called her. Her pizza was already very famous in the North End and as finding a good slice anywhere west of the Mississippi is an arduous feat, I knew that it would be a most valued commodity. So, to commemorate the event I invited my friends and family to taste her masterpiece. It was served and then with great enthusiasm we took our first bite. But, alas, something was wrong. It didn\'t taste the same. \"It\'s the crust!\" we unanimously declared as we watched it sag shamefully before us.', '10:00AM', '3:59AM', '323-951-0070', 'http://www.damorespizza.com/', '', 'Yes', 'Active', '2020-07-06 17:15:55', '2020-07-06 17:15:55'),
