(29, 'Medical Center Of Marin - Patricia L Huertas MD', 33, 0, 16, 0, '', 0, '101 Casa Buena Dr, Corte Madera, CA 94925', '<p>Medical Center of Marin is a fully equipped Urgent Care and Occupational Medicine Clinic conveniently located in Corte Madera, off of Highway 101. We offer minimal wait times, welcome same-day appointments or walk-ins and provide urgent care at less than half the cost of an emergency room visit. We focus on providing the best care to anyone who walks through our doors. Whether it is an urgent need that can&rsquo;t wait for your primary care physician, a work-related injury, or a USCIS exam, you will find our highly trained staff to be capable, professional and courteous. We offer Urgent Care alongside Occupational Medicine services all under one roof including chiropractic, physical therapy, acupuncture, pharmacy, USCIS Medical Exams, sports and school physicals, a thorough and comprehensive Workers&rsquo; Compensation Program. Marin County&mdash;San Rafael&mdash;urgent care and occupational medicine. Our staff is fluent in English, Spanish and Italian. Serving all towns of Marin County.</p>\r\n', 'Medical Center of Marin is a fully equipped Urgent Care and Occupational Medicine Clinic conveniently located in Corte Madera, off of Highway 101. We offer minimal wait times, welcome same-day appointments or walk-ins and provide urgent care at less than half the cost of an emergency room visit. We focus on providing the best care to anyone who walks through our doors. Whether it is an urgent need that can’t wait for your primary care physician, a work-related injury, or a USCIS exam, you will find our highly trained staff to be capable, professional and courteous. We offer Urgent Care alongside Occupational Medicine services all under one roof including chiropractic, physical therapy, acupuncture, pharmacy, USCIS Medical Exams, sports and school physicals, a thorough and comprehensive Workers’ Compensation Program. Marin County—San Rafael—urgent c